@Component({
  selector: 'app-top10',
  templateUrl: './top10.component.html',
  styleUrls: ['./top10.component.css']
})
export class Top10Component {

}
<p>top10 works!</p>
<button
  type="button"
  class="btn btn-secondary timeDiv"
  data-bs-toggle="tooltip"
  data-bs-placement="top"
  data-bs-title="This post was created"
>
  10/10/20023
</button>
